	function [R1n,R3n,R4n,R6n] = BOCTOR_LPF(R2n,R5n,C1n,C2n,wopn,wozn,Qp)	%	%	%	%	%	%	%	sl@tek.sdu.dk	%		clear BOCTOR_LPF;	syms R1n R3n R4n R6n;	f1=wopn==sqrt(1/R4n/R6n/C1n/C2n);	f2=wopn/Qp==1/C2n*(1/R2n+1/R4n+1/R6n);	f3=wozn==sqrt((R1n*R2n+R1n*R4n+R2n*R4n+R2n*R6n+R4n*R6n)/C1n/C2n/R1n/R2n/R4n/R6n);	f4=0==1/R1n/C1n+1/R2n/C2n+1/R4n/C2n+1/R6n/C2n-R3n/R5n/R6n/C1n;	RES=solve(f1,f2,f3,f4);	R1n=vpa(RES.R1n,7);	R3n=vpa(RES.R3n,7);	R4n=vpa(RES.R4n,7);	R6n=vpa(RES.R6n,7);	